import React, { Component } from 'react'

export default class Tournaments extends Component {

    constructor(props){
        super(props);
        this.state={tournaments:[]}
    }

    componentDidMount(){
        console.log("i am mounted");
        const url = "http://www.localhost:8000/tennis/";
        fetch(url, {
            // mode: 'no-cors',
            method: 'GET',
            headers: {
              Accept: 'application/json',
            },
          },
        )
        .then(response => {
        if (response.ok) {
        response.json().then(json => {
        console.log(json);
        this.setState({tournaments:json});
        });
        }
        });
    }

    getEvents = (props) => {
        let newArray = this.state.filter(function (el) {
            return el.price <= 1000 &&
                   el.sqft >= 500 &&
                   el.num_of_beds >=2 &&
                   el.num_of_baths >= 2.5;
          });

    };


    render() {  
        const tournamentItems= [...new Set(this.state.tournaments.map(item => item.event_name))];  
        const tournamentDivItems=tournamentItems.map(item => <div><div className="tournament_div"><p className="tournament_name">{item}</p></div><Events tournamentName={item} /></div>);
        return <div>{tournamentDivItems}</div>;
    }

}
